es.services-opts.tini.enable = true; # files.services-opts.namespace.enable = true; # # RC (unstable) is another interface it uses s6-rc # # http://skarnet.org/software/s6-rc/why.html # # files.rc.hello.enable = true; # files.rc.hello.oneshot.start = ''wait 1000000 "hello world"''; # files.rc.hello.oneshot.stop = ''echo "bye bye world"''; # files.rc.hello.oneshot.timeout = 1200; # # files.rc.olla.enable = true; # files.rc.olla.longrun.start = ''echo "hello world"''; # files.rc.olla.longrun.stop = ''echo "bye bye world"''; # files.rc.olla.longrun.deps = ["hello"]; # # files.rc.hellos.enable = true; # files.rc.hellos.bundle.deps = ["hello" "olla"];
